  components:
  - type: RichText
    properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
      foreground: '', visible: true, font_size: null, content: "**I.\tIdentification**\n\
        \n1. Th\xe8me /Sujet : Taux de phosphate de glauconie \n2. Arr\xeat C1a :\
        \ flanc sud-est du Dyr El Kef (fig.1 et 3)\n3. Localisation : 36.18523, 8.71980\n\
        \n**II.\tConseils et informations pratiques** :\n\n- Situation fonci\xe8re\
        \ : Propri\xe9t\xe9 de l'Etat\n- Acc\xe8s : facile par route goudronn\xe9\
        e en bon \xe9tat\n- Point de d\xe9part : Palais pr\xe9sidentiel (fig.2).\n\
        - Distance : circuit A (environ 1,8 km), circuit B (890m)\n- Absence de signalisation\n\
        - Chemins d'acc\xe8s au site non am\xe9nag\xe9s\n- Risque de disparition par\
        \ alt\xe9ration et action humaine\n- Installer des panneaux de signalisation\
        \ \xe0 l'entr\xe9e du site\n- Mettre \xe0 disposition des visiteurs des affiches\
        \ et des d\xe9pliants d\xe9crivant le site \n- Installer des panneaux expliquant\
        \ l'int\xe9r\xeat du site pour le g\xe9otourisme \n- Installer des panneaux\
        \ d'interdiction de pr\xe9l\xe8vement et de d\xe9gradation du site.\n\n**III.\t\
        Description du site**\n\n**1 Pourquoi visiter le site ?\n\nIl s'agit de d\xe9\
        couvrir un site g\xe9ologique remarquable par sa : \n\n- G\xe9ologie (fossiles\
        \ d'organismes divers, notamment de grandes nummulites et dents de requins,\
        \ plusieurs couches de phosphates reconnaissables \xe0 leur teinte grise,\
        \ leur texture granuleuse, leur odeur f\xe9tide et leur richesse en grains\
        \ de glauconie, un min\xe9ral argileux verd\xe2tre facilement identifiable),\
        \ \n\n- P\xe9dagogie (la pr\xe9sentation de la s\xe9rie g\xe9ologique aux\
        \ \xe9coliers leur permet d'apprendre l'histoire de la g\xe9ologie de la r\xe9\
        gion, en particulier comment les couches s\xe9dimentaires se sont d\xe9pos\xe9\
        es, leur \xe2ge, les fossiles visibles, comment les phosphates se sont d\xe9\
        pos\xe9s, etc...), \n\n- Histoire (trois cimeti\xe8res musulmans, chr\xe9\
        tiens et juifs se c\xf4toient, ainsi que des thermes romains, le temple de\
        \ V\xe9nus et des \xe9crits rupestres),\n\n- Paysage car il domine la ville\
        \ du Kef, avec sa c\xe9l\xe8bre Kasbha, et les vastes plaines verdoyantes\
        \ (surtout au printemps) qui s'\xe9tendent sur des dizaines de kilom\xe8tres\
        \ autour de la ville, parsem\xe9es de montagnes que l'on aper\xe7oit \xe0\
        \ l'horizon jusqu'en Alg\xe9rie.\n\n\n", font: '', spacing_above: small, spacing_below: small,
      data: null, background: '', format: markdown}
    name: rich_text_1
