- type: RichText
  properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
    foreground: '', visible: true, font_size: null, content: "**2.\tR\xe9sum\xe9 des\
      \ informations importantes \xe0 retenir**\nLe long de la route, juste au tournant\
      \ apr\xe8s le cimeti\xe8re des Musulmans (fig.2), on peut observer une succession\
      \ de couches g\xe9ologiques form\xe9es par des alternances de calcaires et de\
      \ marnes grises, intercal\xe9es par plusieurs couches phosphat\xe9es de 50 cm\
      \ environ chacune, ponctu\xe9es de petits grains verts de glauconies et renfermant\
      \ des dents de requins et des rognons de silex (fig.4). On peut reconnaitre\
      \ le minerai phosphat\xe9 gr\xe2ce \xe0 son odeur f\xe9tide. \n\nCes  alternances,\
      \ d\u2019environ 100 m d\u2019\xe9paisseur font suite \xe0 des marnes grises\
      \ \xe0 gypse (terme c, fig. 2) et se poursuit par une dalle de calcaires en\
      \ bancs massifs \xe0 nummulites  de 60 m d\u2019\xe9paisseur (terme d, fig.\
      \ 2). Les alternances phosphat\xe9es et les marnes sous-jacentes appartiennent\
      \ au Pal\xe9oc\xe8ne (-65 \xe0 -53 Ma). La dalle de calcaires \xe0 nummulites\
      \ est dat\xe9e de l\u2019Eoc\xe8ne ((-53 \xe0 \u2013 34 Ma)\n\nLa dalle de calcaires\
      \ \xe0 nummulites n\u2019est pas visible au niveau du site, il faut descendre\
      \ plus bas, tout pr\xe8s des termes romains (fig. 3 et 5) pour la toucher. Ici\
      \ on peut observer en d\xe9tail le faci\xe8s des calcaires, les nummulites et\
      \ \xe9galement des \xe9critures rupestres indiquant que l\u2019homme pr\xe9\
      historique a bien occup\xe9 cette r\xe9gion il y a au moins 2.7 Ma.\n\nL\u2019\
      examen attentif montre que les couches de s\xe9rie d\xe9crite plus haut se distinguent\
      \ par  l\u2019\xe9paisseur, la couleur, les constituants ou faci\xe8s et les\
      \ fossiles qu\u2019elles contiennent. Les fossiles sont des organismes vivants\
      \ qui ont \xe9t\xe9 ensevelis au moment de la s\xe9dimentation des couches en\
      \ milieu marin. Ces fossiles sont utilis\xe9s pour dater les couches dans lesquelles\
      \ ils sont conserv\xe9s. \n\nAinsi les marnes du Pal\xe9oc\xe8ne sont dat\xe9\
      es par les fossiles qu\u2019elles renferment tels les Globotruncana,  Truncorotalia\
      \  et Globigerina). Les nummulites sont des foraminif\xe8res datant la barre\
      \ de calcaires de l\u2019Eoc\xe8ne inf\xe9rieur. \n\nL\u2019examen attentif\
      \ montre que les couches de s\xe9rie d\xe9crite plus haut se distinguent par\
      \  l\u2019\xe9paisseur, la couleur, les constituants ou faci\xe8s et les fossiles\
      \ qu\u2019elles contiennent. Les fossiles sont des organismes vivants qui ont\
      \ \xe9t\xe9 ensevelis au moment de la s\xe9dimentation des couches en milieu\
      \ marin. Ces fossiles sont utilis\xe9s pour dater les couches dans lesquelles\
      \ ils sont conserv\xe9s. \n\n", font: '', spacing_above: small, spacing_below: small,
    data: null, background: '', format: markdown}
