- type: RichText
  properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
    foreground: '', visible: true, font_size: null, content: "\n\nAinsi les marnes\
      \ du Pal\xe9oc\xe8ne sont dat\xe9es par les fossiles qu\u2019elles renferment\
      \ tels les Globotruncana,  Truncorotalia  et Globigerina). Les nummulites sont\
      \ des foraminif\xe8res datant la barre de calcaires de l\u2019Eoc\xe8ne inf\xe9\
      rieur. \n\nCes fossiles sont \xe9galement de bons indicateurs de l\u2019\xe9\
      volution des milieux de d\xe9p\xf4t. Les donn\xe9es pal\xe9ontologiques et le\
      \ faci\xe8s de la roche indiquent que pendant le d\xe9p\xf4t des marnes du Pal\xe9\
      oc\xe8ne, la r\xe9gion du Kef, comme celle de tout le Nord de la Tunisie, \xe9\
      tait couverte par une mer profonde. La s\xe9dimentation phosphat\xe9e et glauconieuse\
      \ indique d\xe9j\xe0 une diminution des profondeurs des eaux cons\xe9cutive\
      \ au comblement des bassins de s\xe9dimentation. Les calcaires \xe0 nummulites\
      \ indiquent un contexte de mer chaude et peu profonde (ne d\xe9passant pas 200\
      \ m de profondeur).\n\n\n\n\nUn mot sur les phosphates\u2026\n-\tIls apparaissent\
      \ \xe0 la base de l\u2019Eoc\xe8ne inf\xe9rieur\n-\tIls renferment une faune\
      \ marine\n-\tIls proviennent de la d\xe9composition des poissons et des reptiles\
      \ marins ou continentaux. \n-\tLes parties organiques des organismes en se d\xe9\
      composant dans certaines conditions forment le min\xe9ral appel\xe9 Phosphate,\
      \ les dents et les nombreux ossements, se sont conserv\xe9s formant des fossiles\
      \ isol\xe9s (dents et os).\n-\tLes phosphates sont actuellement exploit\xe9\
      s dans les bassins phosphat\xe9s de Gafsa.\n-\tLes phosphates sont transform\xe9\
      s en engrais et acide phosphorique utilis\xe9s dans l\u2019agriculture.\n\n\
      **IV.\tEn savoir plus**: \n\n**R\xe9f\xe9rences bibliographiques**\n\n-\tL\xe1\
      szl\xf3 Kocsis et al. (2014) - Pal\xe9oc\xe8ne Eoc\xe8ne palaeoenvironmental\
      \ conditions of the main phosphorite deposits (Chouabine Formation) in the Gafsa\
      \ Basin, Tunisia- Journal of African Earth Sciences 100 (2014) 586\u2013597\n\
      -\tChikhaoui Mongi (1988)- Succession distension-compression dans le sillon\
      \ tunisien secteur de Nebeur, El Kef, Tunisie Centre Nord : r\xf4le des extrusions\
      \ triasiques pr\xe9coces lors des serrages alpins- th\xe8se de doctorat en Sciences\
      \ g\xe9ologiques\n-\tTlili Mohmed (historien)- http://elkef7100.free.fr/Histoire.htm\n\
      -\thttps://fr.wikipedia.org/wiki/Phosphate\n\n**Personnes ressources**\n-\t\
      Mongi Chikhaoui (Chikhaoui_mongi@yahoo.fr)\n-\tMohamed Tlili (historien, Muniscipalit\xe9\
      \ du Kef)\n", font: '', spacing_above: small, spacing_below: small, data: null,
    background: '', format: markdown}
